import { useState } from "react";

import "./App.css";

function App() {
	const [pollData, setpollData] = useState();


		fetch("http://localhost:8000/pollSub").then((response) =>
			response.json().then((data) => setpollData(JSON.parse(data)))
		);


	return <div>{pollData}</div>;
}

export default App;
